TITLE:
  - "Small test to check the implementation of the convective term"
  - "in combination with the Taylor_Hughes_Zarins SUPG stabilization."
  - "The computational domain is square, with a parabolic inflow profile at the left edge."
  - "The permeability is \"numerically\" set to infinity, almost recovering Navier-Stokes for a porosity
    of 1."
  - "Expected result:"
  - "- Porofluid: parabolic inflow profile should flow through the region"
  - "- Porostructure: dirichlet condition suppresses any displacement"
PROBLEM SIZE:
  DIM: 2
PROBLEM TYPE:
  PROBLEMTYPE: "Poroelasticity"
FLUID DYNAMIC:
  LINEAR_SOLVER: 1
  NONLINITER: Newton
  THETA: 0.5
FLUID DYNAMIC/POROUS-FLOW STABILIZATION:
  GRAD_DIV: false
  RSTAB: "rstab_gls"
  DEFINITION_TAU: "Taylor_Hughes_Zarins"
  EVALUATION_TAU: "integration_point"
  EVALUATION_MAT: "integration_point"
IO:
  STRUCT_STRESS: "Cauchy"
  FLUID_STRESS: true
POROELASTICITY DYNAMIC:
  COUPALGO: "Monolithic_fluidsplit"
  PHYSICAL_TYPE: "Poro_P1"
  RESTARTEVERY: 10
  NUMSTEP: 6
  MAXTIME: 10
  NORM_INC: "AbsGlobal"
  NORM_RESF: "AbsGlobal"
  NORMCOMBI_RESFINC: "Or"
  SECONDORDER: false
  CONTIPARTINT: true
  CONVECTIVE_TERM: true
  LINEAR_SOLVER: 2
SOLVER 1:
  SOLVER: "UMFPACK"
SOLVER 2:
  SOLVER: "UMFPACK"
SOLVER 3:
  SOLVER: "UMFPACK"
STRUCTURAL DYNAMIC:
  DYNAMICTYPE: "OneStepTheta"
  NUMSTEP: 1000
  DAMPING: "Material"
  LINEAR_SOLVER: 3
CLONING MATERIAL MAP:
  - SRC_FIELD: "structure"
    SRC_MAT: 1
    TAR_FIELD: "porofluid"
    TAR_MAT: 3
  - SRC_FIELD: "fluid"
    SRC_MAT: 5
    TAR_FIELD: "ale"
    TAR_MAT: 6
MATERIALS:
  - MAT: 1
    MAT_StructPoro:
      MATID: 2
      POROLAWID: 10
      INITPOROSITY: 1
  - MAT: 10
    MAT_PoroLawConstant: {}
  - MAT: 2
    MAT_ElastHyper:
      NUMMAT: 1
      MATIDS: [4]
      DENS: 1
  - MAT: 4
    ELAST_CoupNeoHooke:
      YOUNG: 0.39
      NUE: 1
  - MAT: 3
    MAT_FluidPoro:
      DYNVISCOSITY: 0.001
      DENSITY: 1
      PERMEABILITY: 1e+40
      TYPE: "Darcy-Brinkman"
FUNCT1:
  - SYMBOLIC_FUNCTION_OF_SPACE_TIME: "a*(0.5-y)*(0.5+y)/166.6666*100"
  - VARIABLE: 0
    NAME: "a"
    TYPE: "multifunction"
    NUMPOINTS: 3
    TIMES: [0, 1, 500000]
    DESCRIPTION: ["t", "1.0"]
FUNCT2:
  - COMPONENT: 0
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "1.0"
